import React from 'react';
import { Form } from 'antd';

const Login = () =>{
    return (
        <>
            <h3>로그인</h3>
            <Form>
                <input type="text" value="" />
                <input type="text" value="" />
                <button>로그인</button>
            </Form>
            <p>
                <Button>회원가입</Button>
            </p>
        </>
    );
}

export default Login;
